import TextInput from "../components/shared/TesxtInput";

const Createplaylistmodal = ({ closemodal }) => {
    return (
        <div className="absolute bg-black w-screen h-screen bg-opacity-50 flex justify-center items-center" onClick={closemodal}>
            <div className="bg-app-black w-1/3 rounded-md p-5" onClick={(e)=>{e.stopPropagation();}}>
                <div className="text-white mb-5 font-semibold text-lg">Create Playlist</div>
                <div className="space-y-4 flex flex-col justify-center items-center">
                    <TextInput
                        label="Name"
                        labelclassname={"text-white"}
                        placeholder="Playlist Name"
                    />
                    <TextInput
                        label="Thumbnail"
                        labelclassname={"text-white"}
                        placeholder="Thumbnail"
                    />
                    <div className="bg-white w-1/3 py-3 rounded flex font-semibold justify-center items-center mt-4 cursor-pointer ">Create</div>
                </div>
            </div>
        </div>
    );
}

export default Createplaylistmodal;
